# Support for shopping search in SerpApi

## Who can review?
@vowelparrot

Copies `GraphIndexCreator.from_text()` to make an async version called `GraphIndexCreator.afrom_text()`.

This is (should be) a trivial change: it just adds a copy of `GraphIndexCreator.from_text()` which is async and awaits a call to `chain.apredict()` instead of `chain.predict()`.  There is no unit test for GraphIndexCreator, and I did not create one, but this code works for me locally.

@agola11 @hwchase17

# Reuse `length_func` in `MapReduceDocumentsChain`

Pretty straightforward refactor in `MapReduceDocumentsChain`. Reusing the local variable `length_func`, instead of the longer alternative `self.combine_document_chain.prompt_length`.

